import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getArticles } from "../redux/actions/articles";
import ArticaleCard from "./ArticleCard";

const Articaleslist = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getArticles());
  }, []);
  const articales = useSelector((state) => state.articales);

  return (
    <div>{articales && articales.map((el) => <ArticaleCard el={el} />)}</div>
  );
};

export default Articaleslist;
